import Head from "next/head";
import styled from "styled-components";
import TopNavBar from "../component/topnavbar";
const Test = styled.div`
  color: red;
`;
const Index = () => (
  <div>
    <Head>
      <title>Index 페이지</title>
    </Head>
    <TopNavBar />
  </div>
);

export default Index;
